# characterID: //character id
# thumbnailUrl://分割背景縮圖，為 cdn 的 link，png or jpeg(This is the preview of the character filter.)
# modelType:   //使用的model
# startTime:   //開始時間
# endTime:     //結束時間
# disabled:    //true|false，預設false
# modelFileUrl://圖檔，為 cdn 的 link
# modelFileMD5://是用來確認 client 這邊收到的檔案跟雲端上的是否一致(md5 coming from backend-bot.)
# 在 backend-bot 使用指令 !file upload，跟著要傳送的 .jpg / .zip 一起發送，backend-bot 會回傳 url / md5


